import React from "react";
export function Footer(props) {
  const data = props.data;

  return (
    <div>
      <div className="card-footer text-muted" />
      <button
        type="button"
        className="btn btn-primary"
        onClick={function() {
          props.print(props.data.name);
        }}
      >
        Click
      </button>
    </div>
  );
}
